import React from 'react'
import '../Styles/Carousel.css';
import vertical from '../assets/landscap.png'
import horizontal from '../assets/vertical.jpg'



import {useEffect} from 'react';

function CarouselGallery() {


    useEffect(() => {
        const allWithClass = Array.from(
          document.getElementsByClassName('child')
        );
        console.log(allWithClass.length);
    }, []);

    //   handleClick() {
    //     console.log('Click happened');
    //   };

    function handleClick() {
        console.log("Hi there, user!");
    }


    return (
        <div>
            <div className="parent-images">
                <div className="scrollBar">
                    <div className="child first-child">
                        <img src={vertical} alt="" style={{ height:"100%",objectFit: "cover"}}/>
                    </div>
                    <div className="child">
                        <img src={horizontal} alt="" style={{ height:"100%",objectFit: "cover"}}/>
                    </div>
                    <div className="child">
                        <img src={horizontal} alt="" style={{ height:"100%",objectFit: "cover"}}/>
                    </div>
                    <div className="child">
                        <img src={vertical} alt="" style={{ height:"100%",objectFit: "cover"}}/>
                    </div>
                </div>
            </div>
            <button onClick={handleClick}></button>
        </div>
    )
}

export default CarouselGallery
